import itertools
import math

def get_input(n, len_in):
  lst = [0,1,0,-1]
  new_lst = []
  for i in lst:
      for j in itertools.repeat(i,n):
          new_lst.append(j)
  end_lst = []
  for elt in itertools.cycle(new_lst):
      if len(end_lst) > len_in:
          break
      end_lst.append(elt)
  #print("new_list", end_lst)
  return end_lst[1:len_in + 1]

